import React from "react";
import { makeStyles } from "@material-ui/core";
const useStyle = makeStyles({
  root: {},
  search: {
    width: "30%",
  },
});
const Index = () => {
  const classes = useStyle();
  return (
    <div>
      <input
        type="text"
        placeholder="search for an artist"
        className={classes.search}
      />
    </div>
  );
};

export default Index;
